import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import { Hello } from "./components/hello/hello"

function App() {
  const [clicked, setClicked] = useState<Boolean>();
  const [name, setName] = useState<String>();

  const btnClickLoginHandler = () => { 
    console.log("Button clicked") 
    setClicked(true);
  }

  const btnClickNameHandler = () => { 
    console.log("Button clicked") 
    setName(true);
  }

  return (
    <div className="App">
      <div className="App-wrapper">
        { clicked ? <Hello name = {"Sanzhar"} /> : null}
        <button className="App-click-btn" onClick = {btnClickLoginHandler}>Click</button>
        <button className="App-click-btn" onClick = {btnClickNameHandler}>Change name</button>
      </div>
    </div>
  );
}

export default App;
